import { LiaToolsSolid } from "react-icons/lia";
import getStyling from "./style";
import { FC } from "react";
import { IMappedIconProps } from "./interface";
import {
  IoBuildOutline,
  IoConstructOutline,
  IoSettingsOutline,
  IoHammerOutline,
  IoReaderOutline,
  IoAddCircleOutline,
  IoAdd,
  IoAlertCircleOutline,
  IoBagAddOutline,
  IoBatteryHalf,
  IoBatteryFull,
  IoBriefcaseOutline,
  IoBrushOutline,
  IoBulbOutline,
  IoCalculatorOutline,
  IoCalendarNumberOutline,
  IoCalendarOutline,
  IoCallOutline,
  IoCameraOutline,
  IoCarOutline,
  IoCarSportOutline,
  IoCardOutline,
  IoCartOutline,
} from "react-icons/io5";

const MappedIcon: FC<IMappedIconProps> = (props) => {
  const { iconName, taskIconStyleOverride } = props;
  const styles = getStyling();

