      <IoBatteryHalf
        size={30}
        style={{ ...styles.rowIcon, ...taskIconStyleOverride }}
      />
    );

  if (iconName === "battery-full")
    return (
      <IoBatteryFull
        size={30}
        style={{ ...styles.rowIcon, ...taskIconStyleOverride }}
      />
    );

  if (iconName === "briefcase-outline")
