      />
    );

  if (iconName === "card-outline")
    return (
      <IoCardOutline
        size={30}
        style={{ ...styles.rowIcon, ...taskIconStyleOverride }}
      />
    );

  if (iconName === "card-outline")
    return (
      <IoCardOutline
        size={30}
        style={{ ...styles.rowIcon, ...taskIconStyleOverride }}
      />
    );

  if (iconName === "cart-outline")
    return (
      <IoCartOutline
        size={30}
        style={{ ...styles.rowIcon, ...taskIconStyleOverride }}
      />
    );

  /// ****
  return (
    <LiaToolsSolid
      size={30}
      style={{ ...styles.rowIcon, ...taskIconStyleOverride }}
    />
  );
};

export default MappedIcon;
